import React, { Component } from 'react';
import Filters from '../Filters/Filters';
import LaunchPrograms  from '../LaunchPrograms/LaunchPrograms';

class Layout extends Component {
    

    render() {
        return (<div>
            <h>SpaceX</h>
            <Filters />
            <LaunchPrograms />
        </div>);
    }
}

export default Layout;
